  \"Stillwater Wildlife Management Area, *Anaho Island National Wildlife Refuge and
  Fallon NWR: Refuge Narrative Report: Calendar Year 1972\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:16.213022\",\n\t\"name\": \"stillwater-wildlife-management-area-anaho-island-national-wildlife-refuge-and-fallon-nwr-r\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Stillwater
  WMA, Anaho Island NWR, and Fallon NWR outlines Refuge accomplishments during the
  1972 calendar year. The report begins by summarizing the weather conditions, habitat
  conditions, water conditions, and food and cover conditions during the year. Wildlife-
  including migratory birds, upland game birds, big game animals, furbearers, predators,
  rodents, mammals, raptors, fish, and diseases- is also covered. The Refuge development
  and maintenance section discusses physical developments and plantings. Resource
  management is outlined; topics include grazing and fur harvesting. A progress report
  on field investigations and applied research is also provided. The public relations
  section of the report describes recreational uses, Refuge visitors, Refuge participation,
  hunting, violations, and safety. Items of interest and photographs are attached.\",\n\t\"license_title\":
